# #![allow(unused_imports)] # extern crate nannou;
use nannou::prelude::*;
# fn main() {} This line imports all of the commonly used items from nannou into scope. These include items such as App , Frame , and many more that we will learn about over time. To see the full list of items re-exported by the prelude, see here . Note: Unlike some other languages, Rust does not automatically include everything from the libraries added to the project. This approach results in very clean namespaces and avoids conflicts between different items from different crates. That said, it also means we need to manually import every item we do want to use into scope. By providing a prelude nannou makes it a little easier to access all of the commonly used items.

