# use nannou::prelude::*;
# struct Model {}
# fn main() { nannou::app(model) // Start building the app and specify our `model` .event(event) // Specify that we want to handle app events with `event` .simple_window(view) // Request a simple window to which we'll draw with `view` .run(); // Run it!
# }
# fn model(_app: &App) -> Model {
# Model {}
