# fn event(_app: &App, _model: &mut Model, _event: Event) {
# }
# fn view(_app: &App, _model: &Model, frame: Frame) -> Frame {
# frame
# } We will describe what these model , event and view functions do below! Note: In this app building process we get a hint at the fundamental design archetype of nannou apps. The approach is roughly based on the Model-View-Controller (MVC) pattern , though equally inspired by Functional Reactive Programming (FRP) . In general, these paradigms split a program into: a model describing the internal state a view describing how to present the model and a controller describing how to update the model on certain events. If you zoom out a bit you can think of the computer as a model, the screen as a view (the audio output could also be thought of as a view), and the keyboard (or mouse) as the controller. A user looks at the view and can change the state of the model using the controller. If a program does not require user input, the controller might use an algorithm based on time or some other application event to modify the model.

